import React from 'react'
import Input from './Input'


function FormControl(props) {
    const {control}= props
    switch (control){
        case "input":
            return <Input {...rest}/>
        case "textarea":
        case "select":
        case "radio":
        case "checkbox":
        case "date":
        default:return null
    }
    return (
        <div>
            
        </div>
    )
}

export default FormControl;
